import React from 'react';
import './App.css'
import Botao from './Botao';


import GerarNumeros from './GeradorNumeros.tsx';



function App() {




  return (
    <div className="App">
      <h1>Gerador de jogos da loto fácil</h1>

      <GerarNumeros />
     <Botao onClick={()=>console.log(GerarNumeros())}>
      Gerar Numeros
     </Botao>

    </div>
  );
}

export default App;
